import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      saludo_inicial: 'Hola :v',
      saludo_final: '',
    }
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{this.state.saludo_inicial}</p>
          <button onClick={() => this.setState({ saludo_final: 'Que hace v:' })}>Responder al Hola</button>
          <p>
          {this.state.saludo_final}
          </p>
        </header>
      </div>
    );
  }
}

export default App;
